import React, { useState } from 'react';
import './SignUpPage.css';
import googleIcon from '../assets/google.png';
import universityIcon from '../assets/university.png';
import marketImage from '../assets/market.jpg';

const SignUpPage = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    rememberMe: false
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  return (
    <div className="signup-page">
      <div className="signup-container">
        <div className="left-side">
          <div className="header">
            <h1>TechSell</h1>
            <p>Your Campus, Your Market</p>
          </div>

          <div className="auth-buttons">
            <button className="btn-dark">Sign Up</button>
            <button className="btn-light">Log In</button>
          </div>

          <div className="form-content">
            <h2>Begin your shopping with us</h2>
            <p>Sign Up with open account</p>

            <div className="social-login">
              <button className="social-btn">
                <img src={universityIcon} alt="University" />
              </button>
              <button className="social-btn">
                <img src={googleIcon} alt="Google" />
              </button>
            </div>

            <div className="divider">or</div>

            <form>
              <input 
                type="text"
                name="username"
                placeholder="username"
                value={formData.username}
                onChange={handleChange}
              />
              <input
                type="email"
                name="email"
                placeholder="student email"
                value={formData.email}
                onChange={handleChange}
              />
              <input
                type="password"
                name="password"
                placeholder="password"
                value={formData.password}
                onChange={handleChange}
              />
              
              <div className="remember-me">
                <input
                  type="checkbox"
                  name="rememberMe"
                  checked={formData.rememberMe}
                  onChange={handleChange}
                />
                <label>Remember Me</label>
              </div>

              <button type="submit" className="shop-now-btn">Shop Now</button>
            </form>

            <p className="footer-text">Become a rider? Deliver your own products!</p>
          </div>
        </div>

        <div className="right-side">
          <img src={marketImage} alt="Market" className="market-image" />
        </div>
      </div>
    </div>
  );
};

export default SignUpPage;
